    \ CONF_FORECAST_DAILY_TEMPLATE,\n    CONF_FORECAST_HOURLY_TEMPLATE, CONF_FORECAST_TWICE_DAILY_TEMPLATE,\n\
    \    CONF_OZONE_TEMPLATE, CONF_PRESSURE_TEMPLATE, CONF_VISIBILITY_TEMPLATE,\n\
